var express=require("express");var app=express();var port=3e3;app.get("/",(e,s)=>{s.send("Hello World!")});app.listen(port,()=>console.log(`Example app listening on port ${port}!`));function add_users_routes(e){e.get("/users",(e,s)=>{console.info("Received a GET HTTP method");return s.send("Received a GET HTTP method")});e.post("/users",(e,s)=>{return s.send("Received a POST HTTP method")});e.put("/users",(e,s)=>{return s.send("Received a PUT HTTP method")});e.delete("/users",(e,s)=>{return s.send("Received a DELETE HTTP method")})}module.exports={add_users_routes:add_users_routes};